    S_s (1, i) = length (S);    % delta集大小
   
    K = Sshull (S);            % sensitivity hull
    [at, T] = Isotropictrans(  K );

    KI = (T*(K'))';

    y(i, :) = PIM(r, KI, T, z1) ;          % 扰动位置  释放的位置
    S_s (2, i) = norm (y(i, :) - z1);       %扰动位置与代理的距离  噪声的大小
    S_s (3, i) = norm (y(i, :) - z(i, :));  %扰动位置与实际位置的距离

    p2 = PRelease_V(r, KI, T, y(i,:), p1);      %释放概率

    p3 = PostUpdate(p1, p2);              %后验概率

    p(i+1, :) = p3 * M;

end

